/*
In this Kata, you have to sort a vector of integers according to
number of ones in their binary representation in ascending order.
For similar number of ones, sort based on decimal value.

It must be implemented like this:
>>> sort_array({1, 5, 2, 3, 4}) == {1, 2, 4, 3, 5}
>>> sort_array({-2, -3, -4, -5, -6}) == {-4, -2, -6, -5, -3}
>>> sort_array({1, 0, 2, 3, 4}) == {0, 1, 2, 4, 3}
*/
#include<stdio.h>
#include<math.h>
#include<vector>
#include<algorithm>
using namespace std;
vector<int> sort_array(vector<int> arr){
    // Custom comparator function to sort based on number of ones in binary representation
    auto cmp = [](int a, int b) {
        int countA = __builtin_popcount(abs(a));
        int countB = __builtin_popcount(abs(b));
        if (countA == countB) {
            return a < b;
        }
        return countA < countB;
    };

    // Sort the vector using the custom comparator
    sort(arr.begin(), arr.end(), cmp);

    return arr;
}
#undef NDEBUG
#include<assert.h>
bool issame(vector<int> a,vector<int>b){
    if (a.size()!=b.size()) return false;
    for (int i=0;i<a.size();i++)
    {
    if (a[i]!=b[i]) return false;
    }
    return true;
}
int main(){
