bool is_palindrome(std::string str) {
    std::string s(str.rbegin(), str.rend());
    return s == str;
}

std::string find_longest_palindrome(const std::string& s, int left, int right) {
    while (left >= 0 && right < s.size() && s[left] == s[right]) {
        left--;
        right++;
    }
    return s.substr(left + 1, right - left - 1);
}

std::string make_palindrome(std::string str) {
    if (str.empty()) {
        return "";
    }

    for (int i = str.size() - 1; i >= 0; i--) {
        std::string palindrome_suffix = find_longest_palindrome(str, i, i);
        if (!palindrome_suffix.empty()) {
            return str.substr(0, i) + std::string(str.begin() + i - palindrome_suffix.size(), str.begin() + i) + str.substr(i);
        }
    }

    return str.substr(0, str.size() - 1) + std::string(str.rbegin() + 1, str.rend());
}

