#include <vector>
#include <string>
using namespace std;

vector<string> separate_paren_groups(string paren_string) {
    vector<string> result;
    vector<char> stack;
    string current = "";
    for (char c : paren_string) {
        if (c == '(') {
            stack.push_back('(');
            current += c;
        } else if (c == ')') {
            stack.pop_back();
            current += c;
            if (stack.empty()) {
                result.push_back(current);
                current = "";
            }
        }
    }
    return result;
}

