boost::any compare_one(boost::any a, boost::any b) {
    if (a.type() == b.type()) {
        if (a.type() == typeid(int) || a.type() == typeid(float)) {
            return max(boost::any_cast<int>(a), boost::any_cast<int>(b));
        }
        else if (a.type() == typeid(string)) {
            string a_str = boost::any_cast<string>(a);
            string b_str = boost::any_cast<string>(b);
            float a_num = stof(a_str);
            float b_num = stof(b_str);
            if (a_num > b_num) {
                return a;
            }
            else {
                return b;
            }
        }
    }
    else if (boost::any_cast<string>(a) == boost::any_cast<string>(b)) {
        return "None";
    }
    return nullptr;
}

