            std::replace(str_a.begin(), str_a.end(), ',', '.');
            std::replace(str_b.begin(), str_b.end(), ',', '.');
        }
        return std::max(str_a, str_b);
    }
    return std::max(std::to_string(boost::any_cast<decltype(a)>(a)), std::to_string(boost::any_cast<decltype(b)>(b)));
}

