#include <string>
#include <iostream>

int digits(int n) {
    int product = 1;
    bool has_odd = false;
    std::string num_str = std::to_string(n);

    for (char digit : num_str) {
        int num = digit - '0';
        if (num % 2 != 0) {
            product *= num;
            has_odd = true;
        }
    }

    return has_odd ? product : 0;
}

