#include <unordered_map>

int do_algebra(std::vector<std::string> operators, std::vector<int> operands) {
    std::unordered_map<std::string, int> precedence = {{"+", 1}, {"-", 1}, {"*", 2}, {"//", 2}, {"**", 3}};
    std::stack<int> stack;

    auto apply_operator = [](std::string op, std::stack<int>& stack) {
        int b = stack.top();
        stack.pop();
        int a = stack.top();
        stack.pop();
        if (op == "+") {
            stack.push(a + b);
        } else if (op == "-") {
            stack.push(a - b);
        } else if (op == "*") {
            stack.push(a * b);
        } else if (op == "//") {
            stack.push(a / b);
        } else if (op == "**") {
            stack.push(pow(a, b));
        }
    };

    for (size_t i = 0; i < operators.size(); i++) {
        while (!stack.empty() && precedence[operators[i]] <= precedence[std::to_string(stack.top())]) {
            int top = stack.top();
            stack.pop();
            apply_operator(std::to_string(top), stack);
        }
        stack.push(operands[i]);
        stack.push(std::stoi(operators[i]));
    }

    stack.push(operands.back());

    while (!stack.empty()) {
        int token = stack.top();
        stack.pop();
        if (precedence.find(std::to_string(token)) != precedence.end()) {
            apply_operator(std::to_string(token), stack);
        } else {
            stack.push(token);
        }
    }

    return stack.top();
}

