#include <iostream>
#include <string>
#include <vector>
#include <map>
#include <algorithm>

std::string sort_numbers(std::string numbers) {
    std::map<std::string, int> number_dict = {
        {"zero", 0},
        {"one", 1},
        {"two", 2},
        {"three", 3},
        {"four", 4},
        {"five", 5},
        {"six", 6},
        {"seven", 7},
        {"eight", 8},
        {"nine", 9}
    };

    std::vector<std::string> numbers_list;
    std::string word = "";
    for (char c : numbers) {
        if (c == ' ') {
            numbers_list.push_back(word);
            word = "";
        } else {
            word += c;
        }
    }
    numbers_list.push_back(word);

    std::sort(numbers_list.begin(), numbers_list.end(), [&](const std::string& a, const std::string& b) {
        return number_dict[a] < number_dict[b];
    });

    std::string result = "";
    for (const std::string& num : numbers_list) {
        result += num + " ";
    }
    result.pop_back(); // Remove the extra space at the end
    return result;
}

#undef NDEBUG
#include<assert.h>
int main(){
    assert (sort_numbers("") == "");
    assert (sort_numbers("three") == "three");
    assert (sort_numbers("three five nine") == "three five nine");
     assert (sort_numbers("five zero four seven nine eight") == "zero four five seven eight nine");
      assert (sort_numbers("six five four three two one zero") == "zero one two three four five six");
}

