/*
Input is a space-delimited string of numberals from "zero" to "nine".
Valid choices are "zero", "one", 'two", 'three", "four", "five", 'six", 'seven", "eight" and "nine".
Return the string with numbers sorted from smallest to largest
>>> sort_numbers('three one five")
"one three five"
*/
#include<stdio.h>
#include<string>
#include<map>
using namespace std;
string sort_numbers(string numbers){
    map<string, int> number_map = {
        {"zero", 0},
        {"one", 1},
        {"two", 2},
        {"three", 3},
        {"four", 4},
        {"five", 5},
        {"six", 6},
        {"seven", 7},
        {"eight", 8},
        {"nine", 9}
    };

    string result = "";
    map<int, string> sorted_numbers;

    size_t pos = 0;
    string token;
    while ((pos = numbers.find(" ")) != string::npos) {
        token = numbers.substr(0, pos);
        sorted_numbers[number_map[token]] = token;
        numbers.erase(0, pos + 1);
    }
    sorted_numbers[number_map[numbers]] = numbers;

    for (auto const& pair : sorted_numbers) {
        result += pair.second + " ";
    }

    return result.substr(0, result.size() - 1);
}
#undef NDEBUG
#include<assert.h>
int main(){
    assert (sort_numbers("") == "");
    assert (sort_numbers("three") == "three");
    assert (sort_numbers("three five nine") == "three five nine");
     assert (sort_numbers("five zero four seven nine eight") == "zero four five seven eight nine");
      assert (sort_numbers("six five four three two one zero") == "zero one two three four five six");
}

