#include <string>
#include <vector>

std::string match_parens(std::vector<std::string> lst) {
    int open_count = 0;
    int close_count = 0;
    for (const std::string& s : lst) {
        for (char c : s) {
            if (c == '(') {
                open_count++;
            } else {
                if (open_count > 0) {
                    open_count--;
                } else {
                    close_count++;
                }
            }
        }
    }
    return (open_count == 0 && close_count == 0) ? "Yes" : "No";
}

