using namespace std;

int sum_of_digits(int num) {
    int sum = 0;
    int temp = abs(num);
    while (temp != 0) {
        sum += temp % 10;
        temp /= 10;
    }
    return sum;
}

int count_nums(vector<int> n) {
    int count = 0;
    for (int num : n) {
        if (sum_of_digits(num) > 0) {
            count++;
        }
    }
    return count;
}

#undef NDEBUG
#include<assert.h>
