    for(int i=0; i<s.length(); i++){
        char c = s[i];
        if(isalpha(c)){
            char base = isupper(c) ? 'A' : 'a';
            c = (c - base + 2*2) % 26 + base;
        }
        result += c;
    }
    return result;
}
