string encrypt(string s){
    string result = "";
    for(int i=0; i<s.length(); i++){
        if(isalpha(s[i])){
            char c = s[i];
            if(islower(c)){
                c = 'a' + (c - 'a' + 2*2) % 26;
            } else {
                c = 'A' + (c - 'A' + 2*2) % 26;
            }
            result += c;
        } else {
            result += s[i];
        }
    }
    return result;
}
