#include <vector>
#include <algorithm>
#include <unordered_map>

bool is_sorted(std::vector<int> lst) {
    std::unordered_map<int, int> count_map;

    for (int num : lst) {
        if (count_map.find(num) != count_map.end()) {
            count_map[num]++;
            if (count_map[num] > 2) {
                return false;
            }
        } else {
            count_map[num] = 1;
        }
    }

    std::vector<int> unique_sorted_lst(lst.begin(), lst.end());
    std::sort(unique_sorted_lst.begin(), unique_sorted_lst.end());
    unique_sorted_lst.erase(std::unique(unique_sorted_lst.begin(), unique_sorted_lst.end()), unique_sorted_lst.end());

    return lst == unique_sorted_lst;
}

#undef NDEBUG
#include<assert.h>
int main(){
    assert (is_sorted({5}) == true);
    assert (is_sorted({1, 2, 3, 4, 5}) == true);
    assert (is_sorted({1, 3, 2, 4, 5}) == false);
    assert (is_sorted({1, 2, 3, 4, 5, 6}) == true);
    assert (is_sorted({1, 2, 3, 4, 5, 6, 7}) == true);
    assert (is_sorted({1, 3, 2, 4, 5, 6, 7}) == false);
    assert (is_sorted({}) == true);
    assert (is_sorted({1}) == true);
    assert (is_sorted({3, 2, 1}) == false);
    assert (is_sorted({1, 2, 2, 2, 3, 4}) == false);
    assert (is_sorted({1, 2, 3, 3, 3, 4}) == false);
    assert (is_sorted({1, 2, 2, 3, 3, 4}) == true);
    assert (is_sorted({1, 2, 3, 4}) == true);
}

