vector<int> minPath(vector<vector<int>>& grid, int k) {
    int n = grid.size();
    vector<pair<int, int>> directions = {{0, 1}, {0, -1}, {1, 0}, {-1, 0}};

    auto isValid = [&](int x, int y) {
        return x >= 0 && x < n && y >= 0 && y < n;
    };

    function<vector<int>(int, int, vector<int>&)> dfs = [&](int x, int y, vector<int>& path) -> vector<int> {
        if (path.size() == k) {
            return path;
        }

        int current_val = grid[x][y];
        grid[x][y] = -1;
        vector<pair<int, int>> next_moves;
        for (auto [dx, dy] : directions) {
            int new_x = x + dx, new_y = y + dy;
            if (isValid(new_x, new_y) && grid[new_x][new_y] != -1) {
                next_moves.emplace_back(new_x, new_y);
            }
        }

        sort(next_moves.begin(), next_moves.end(), [&](const pair<int, int>& a, const pair<int, int>& b) {
            return grid[a.first][a.second] < grid[b.first][b.second];
        });

        for (const auto& [new_x, new_y] : next_moves) {
            vector<int> result = dfs(new_x, new_y, path);
            if (!result.empty()) {
                return result;
            }
        }

        grid[x][y] = current_val;
        return {};
    };

    for (int i = 0; i < n; i++) {
        for (int j = 0; j < n; j++) {
            vector<int> result = dfs(i, j, {});
            if (!result.empty()) {
                return result;
            }
        }
    }

    return {};
}

