            return grid[a.first][a.second] < grid[b.first][b.second];
        });

        for (const auto& next_move : next_moves) {
            std::vector<int> res = dfs(next_move.first, next_move.second, path);
            if (!res.empty()) {
                return res;
            }
        }

        grid[x][y] = current_val; // Backtrack
        return {};
    };

    for (int i = 0; i < n; i++) {
        for (int j = 0; j < n; j++) {
            result = dfs(i, j, {grid[i][j]});
