int modp(int n,int p){
    if (n == 0) {
        return 1;
    } else {
        long long result = 1;
        long long base = 2;
        n = n % (p - 1); // Using Fermat's Little Theorem
        while (n > 0) {
            if (n % 2 == 1) {
                result = (result * base) % p;
            }
            n = n / 2;
            base = (base * base) % p;
        }
        return result;
    }
} 


