/*
Given a positive integer, obtain its roman numeral equivalent as a string,
and return it in lowercase.
Restrictions: 1 <= num <= 1000

Examples:
>>> int_to_mini_roman(19) == "xix"
>>> int_to_mini_roman(152) == "clii"
>>> int_to_mini_roman(426) == "cdxxvi"
*/
#include<stdio.h>
#include<vector>
#include<string>
using namespace std;
string int_to_mini_roman(int number){
    // Create vectors to store the roman numeral symbols and their corresponding values
    vector<int> values = {1000, 900, 500, 400, 100, 90, 50, 40, 10, 9, 5, 4, 1};
    vector<string> symbols = {"M", "CM", "D", "CD", "C", "XC", "L", "XL", "X", "IX", "V", "IV", "I"};

    // Initialize an empty string to store the roman numeral equivalent
    string roman = "";

    // Iterate through the values and symbols vectors to build the roman numeral equivalent
    for (int i = 0; i < values.size(); i++) {
        while (number >= values[i]) {
            roman += symbols[i];
            number -= values[i];
        }
    }

    // Convert the roman numeral to lowercase
    for (int i = 0; i < roman.size(); i++) {
        roman[i] = tolower(roman[i]);
    }

    return roman;
}
