#include <vector>
#include <algorithm>
#include <string>

int digitSum(int num) {
    if (num < 0) {
        num = -num;
    }
    int sum = 0;
    while (num > 0) {
        sum += num % 10;
        num /= 10;
    }
    return sum;
}

vector<int> order_by_points(vector<int> nums) {
    sort(nums.begin(), nums.end(), [&](int a, int b) {
        int sum_a = digitSum(a);
        int sum_b = digitSum(b);
        if (sum_a == sum_b) {
            return find(nums.begin(), nums.end(), a) - nums.begin() < find(nums.begin(), nums.end(), b) - nums.begin();
        }
        return sum_a < sum_b;
    });
    return nums;
}

