bool simplify(string x, string n) {
    auto isWholeNumber = [](const string& fraction) {
        int numerator, denominator;
        char delimiter;
        istringstream iss(fraction);
        iss >> numerator >> delimiter >> denominator;
        return numerator % denominator == 0;
    };

    auto gcd = [](int a, int b) {
        while (b) {
            a %= b;
            swap(a, b);
        }
        return a;
    };

    int x_num, x_den, n_num, n_den;
    char delimiter;
    istringstream iss_x(x), iss_n(n);
    iss_x >> x_num >> delimiter >> x_den;
    iss_n >> n_num >> delimiter >> n_den;

    int new_num = x_num * n_num;
    int new_den = x_den * n_den;

    int common = gcd(new_num, new_den);
    new_num /= common;
    new_den /= common;

    return isWholeNumber(to_string(new_num) + "/" + to_string(new_den));
}

