bool move_one_ball(std::vector<int> arr) {
    if (arr.empty()) {
        return true;
    }
    std::vector<int> sorted_arr = arr;
    std::sort(sorted_arr.begin(), sorted_arr.end());
    int n = arr.size();
    for (int i = 0; i < n; i++) {
        if (arr == sorted_arr) {
            return true;
        }
        int last_element = arr.back();
        arr.pop_back();
        arr.insert(arr.begin(), last_element);
    }
    return false;
}

